import React, { useState } from 'react';
import './styles/About.css';

const AboutMe = () => {
  const [hover, setHover] = useState(false);

  return (
    <div className="about-me-section bg-[#141414] text-white">
      <div className="about-me-container mx-auto max-w-5xl px-6 py-20">
        {/* About Me Header */}
        <div className="about-me-header flex flex-col items-center sm:flex-row sm:items-start">
          {/* Photo Section */}
          <div className="photo-container flex-shrink-0 mr-8 mb-8 sm:mb-0">
            <img
              src="/path/to/your-photo.jpg"  // Add the path to your photo here
              alt="Daphne"
              className="about-me-photo rounded-full w-40 h-40 sm:w-56 sm:h-56 object-cover"
            />
          </div>

          <div className="text-center sm:text-left">
            <h1 className="text-4xl sm:text-6xl font-bold font-sono">
              hi, i'm daphne.
            </h1>
            <p className="text-lg sm:text-xl font-mono mt-4 max-w-2xl mx-auto sm:mx-0">
              I'm a passionate designer and developer creating beautiful, functional digital experiences.
            </p>
          </div>
        </div>

        {/* About Me Body */}
        <div className="about-me-body mt-12 text-center sm:text-left">
          <p className="text-lg sm:text-xl max-w-2xl mx-auto sm:mx-0">
            I believe in making digital products that don't just function, but inspire. Whether it's designing interfaces that feel intuitive or exploring AI to craft personalized experiences, my goal is to leave a lasting impact.
          </p>

          {/* Skills Section */}
          <div className="skills mt-8">
            <h2 className="text-2xl font-bold text-center sm:text-left">
              Skills & Expertise
            </h2>
            <ul className="mt-4 text-lg sm:text-xl">
              <li>• UI/UX Design</li>
              <li>• Frontend Development</li>
              <li>• AI Integration</li>
              <li>• Visual Design & Branding</li>
            </ul>
          </div>
        </div>

        {/* Call to Action Button */}
        <div className="cta mt-12 text-center">
          <button
            onClick={() => window.location.href = "/contact"} // Link to the contact page
            onMouseEnter={() => setHover(true)}
            onMouseLeave={() => setHover(false)}
            className={`mt-12 px-8 py-4 border border-white text-white text-lg rounded-full transition-all duration-300 
              ${hover ? 'bg-[#4f9bcf] text-black' : 'bg-transparent'} 
              hover:bg-[#4f9bcf] hover:border-transparent hover:text-black`}
          >
            → let's work together
          </button>
        </div>
      </div>
    </div>
  );
};

export default AboutMe;
